import React from "react";
import axios from "axios";

class App extends React.Component {
  state = {
    users: [],
    username: "",
    email: "",
  };

  componentDidMount = () => {
    this.getBlogPost();
  };

  getBlogPost = () => {
    axios
      .get("/api")
      .then((response) => {
        const data = response.data;
        this.setState({ users: data });
        console.log("Data has been recieved");
        console.log(data);
      })
      .catch(() => {
        alert("Error retriving data");
      });
  };
  displayLogPost = (users) => {
    if (!users.lenght) return null;
  };

  render() {
    const { users } = this.state;
    return (
      <div className="das">
        {/* {this.displayLogPost(this.state.users)}
         */}

        {users.map((user, index) => (
          <div key={index}>
            {/* <h1>{user.username}</h1>
            <p>{user.email}</p> */}

            <table>
              <tr>
                <th>Username</th>
                <th>Email</th>
              </tr>
              <tr>
                <td>{user.username}</td>
                <td>{user.email}</td>
              </tr>
            </table>

          </div>
        ))}
      </div>
    );
  }
}
export default App;
